import React from 'react'
import $ from 'jquery'
import './Storie.css'

 
	
	
	var randomizer = parseInt(Math.random()*72+1);

export default	function bgImage() {
  		const imageUrl = require('./imgs/'+randomizer+'.jpg')
	
	return <div className="first" style={{ backgroundImage:`url(${imageUrl})` }}> </div>

}
